import totalToRender from "../profileTotal/totalToRender"
import ProfileListItem from "./profileListItem"


export default function renderProfileList(value, totalToRenderNumber) {
  return totalToRender(value, totalToRenderNumber).map((item, i) => (
    <ProfileListItem 
      key={`ListItem${i}`} 
      data={item}
      focused={props.focused} 
      setFocused={props.setFocused}/>
  ))
}
